import React from 'react'

export default function Usernavbar() {
  return (
    <div className='navbar'>
        <NavLink
        exact
        to="/"
        className={(navData) => (navData.isActive ? "active" : "navlink")}
      >
        Home
      </NavLink>
    </div>
  )
}
